import React from "react";
import { Navbar, Container } from "react-bootstrap";

const Header = () => {
  return (
    <div>
      <Navbar bg="dark" expand="lg">
          <Container>
          <Navbar.Brand href="#home">Dashboard</Navbar.Brand>

        {/* <strong>Dashboard</strong> */}
        </Container>
      </Navbar>
    </div>
  );
};

export default Header;
